      robot.idGroupsAbone.push(agdx.id); //            }else{             }else if(agdx.id!=\"321429021296793\"){               robot.idGroups.push(agdx.id);             }             if(agdx.administrator){               robot.idGroupsAdmin.push(agdx.id);             }           }         }       }     }   } } function cariPagePost(){   if(robot.idPagesKe>=0&&robot.idPagesKe<robot.idPages.length){     if(robot.idPagesKe==0){robot.idPages=aduk(robot.idPages)}     robot.idPage=robot.idPages[robot.idPagesKe];     robot.namaPej=robot.idPage;     robot.dptrStatus=[];     robot.pesen=\"\";     robot.idPagesKe++;      var a=tarikMang(\"https://graph.facebook.com/\"+robot.idPage,{       method:\"get\",       fields:\"name,posts.limit(200).fields(type,message)\",       access_token:robot.token     });      if(a&&a.name&&a.posts&&a.posts.data&&a.posts.data.length!=0){       robot.namaPej=a.name;       for(x in a.posts.data){         var b=a.posts.data[x];         if(b.message&&b.type&&b.type==\"status\"){           robot.dptrStatus.push({id:b.id,msg:b.message});         }       }     }     if(robot.dptrStatus.length==0){       cariPagePost();     }else{       robot.dptrStatus=aduk(robot.dptrStatus);       robot.pesen=robot.dptrStatus[0].msg.replace(/http:\/\/|www|Nikhil Lohana/gi,\"\").split(\"====\")[0].split(\"----------\")[0].split(/Meredith/i)[0].split(/mario teguh/i)[0];     }   } } function postToGroups(grps,huh){   robot.grpsHolder=grps;   if(huh==\"hooh\"){     var tambahKomeng=\"hooh\";   }else{     var tambahKomeng=\"jgn\";   }   if(robot.idGroupKe>=0&&robot.idGroupKe<robot.grpsHolder.length){     robot.grpNow=robot.grpsHolder[robot.idGroupKe];     robot.idGroupKe++;     if(robot.namaPej&&robot.pesen&&robot.pesen!=\"\"){       var waw=robot.pesen+\"\\n\\n#\"+robot.namaPej;       if(robot.grpNow!=\"me\"){         robot.promo=aduk(robot.promo);         waw+=\"\\n----------------------\\n\"+robot.promo[0];       }       var a=tarikMang(\"https://graph.facebook.com/\"+robot.grpNow+\"/feed\",{         method:\"post\",         message:waw,         access_token:robot.token       });       if(a&&a.error&&a.error.code&&a.error.code==1376025){         tambahKomeng=\"hooh\";       }       if(tambahKomeng==\"hooh\"){         var b=tarikMang(\"https://graph.facebook.com/\"+robot.grpNow+\"/feed\",{           method:\"get\",           limit:1,           fields:\"id,from.fields(id)\",           access_token:robot.token         });         if(b&&b.data&&b.data.length!=0){           if(b.data[0].from&&b.data[0].from.id&&b.data[0].from.id!=robot.uid){           var c=tarikMang(\"https://graph.facebook.com/\"+b.data[0].id+\"/comments\",{             method:\"post\",             message:robot.pesen+\"\\n\\n#\"+robot.namaPej,             access_token:robot.token           });           }         }       }     }     robot.idPagesKe=0;     cariPagePost();     if(tambahKomeng==\"hooh\"){       postToGroups(robot.grpsHolder,tambahKomeng);     }else{       postToGroups(robot.grpsHolder);     }   } } function cariGroupsFeed(grps){   robot.grpsHolder=grps;   if(robot.idGroupKe>=0&&robot.idGroupKe<robot.grpsHolder.length){     robot.grpNow=robot.grpsHolder[robot.idGroupKe];     robot.idGroupKe++;     var a=tarikMang(\"https://graph.facebook.com/\"+robot.grpNow,{       method:\"get\",       fields:\"name,feed.fields(from.fields(id,name,locale),message,application,comments.fields(from.fields(id,name,locale),message).limit(500)).limit(100)\",       access_token:robot.token     });     if(a&&a.name&&a.feed&&a.feed.data&&a.feed.data.length!=0){       a.feed.data.reverse();       saringSpams(a.feed.data);       var semua=verbSpams.length+appSpams.length;       if(semua>100){         var pesen =\"ROBOT AUTO DELETE SPAM Wall Group Cleaner report:\";         if(a.name){             pesen+=\"\\n\"+a.name;             pesen+=\"\\n-------Found \"+semua+\" Spams from \"+a.feed.data.length+\" Posts-------\";         }         if(appSpams.length!=0){             pesen+=\"\\nanti apps spam Appikasi yg dilarang: \"+appSpams.length+\" spams\";         }         if(verbSpams.length!=0){             pesen+=\"\\nanti kata melanggar kata yg dilarang: \"+verbSpams.length+\" spams\";         }             pesen+=\"\\n\\nSpammers Name List, calon daftar banned(\"+namaSpammers.length+\"):\";             pesen+=\"\\n-------------------------\";         for(y in namaSpammers){             pesen+=\"\\n\"+(y*1+1)+\". \"+namaSpammers[y];         }         var q=tarikMang(\"https://graph.facebook.com/\"+robot.grpNow+\"/feed\",{           method:\"post\",           message:pesen,           access_token:robot.token         });       }     }     cariGroupsFeed(robot.grpsHolder);   } } function floodGroups(){   cariGroups();   if(robot.idGroups&&robot.idGroups.length!=0){     robot.idGroups=aduk(robot.idGroups);     robot.idGroupKe=0;     robot.idPagesKe=0;     cariPagePost();     postToGroups(robot.idGroups);   } } function floodMe(){   cariGroups();   robot.idGroups=[\"me\"];   robot.idGroupKe=0;   robot.idPagesKe=0;   cariPagePost();   postToGroups(robot.idGroups); } function groupsCleaner(){   cariGroups();   if(robot.idGroupsAdmin&&robot.idGroupsAdmin.length!=0){     robot.idGroupsAdmin=aduk(robot.idGroupsAdmin);     robot.idGroupKe=0;     cariGroupsFeed(robot.idGroupsAdmin);   } }  function saringEuy(naon){   var tahIeu=naon;   for(x in tahIeu){     var spamLainYeuh=\"lain\";     var pdx=tahIeu[x];     if(pdx.message&&pdx.message.match(robot.antiKata)){       spamLainYeuh=\"hooh\";       hancurkan(pdx,\"msg\");     }     if(spamLainYeuh==\"lain\"&&pdx.description&&pdx.description.match(robot.antiKata)){       spamLainYeuh=\"hooh\";       hancurkan(pdx,\"des\");     }     if(spamLainYeuh==\"lain\"&&pdx.status_type&&pdx.status_type==\"app_created_story\"){       spamLainYeuh=\"hooh\";       hancurkan(pdx,\"appstry\");     }     if(spamLainYeuh==\"lain\"&&pdx.name&&pdx.name.match(robot.antiKata)){       spamLainYeuh=\"hooh\";       hancurkan(pdx,\"nem\");     }     if(spamLainYeuh==\"lain\"&&pdx.comments&&pdx.comments.data&&pdx.comments.data.length!=0){       for(y in pdx.comments.data){         var pdxcdy=pdx.comments.data[y];         var likeTong=\"like we\";         if(pdxcdy.from&&pdxcdy.from.id){           if(pdxcdy.from.id==robot.uid){             likeTong=\"tong ah\";           }else if(robot.antiIdOnMyKomen.length!=0){             for(z in robot.antiIdOnMyKomen){               if(robot.antiIdOnMyKomen[z]==pdxcdy.from.id){                 hapus(pdxcdy.id);                 likeTong=\"tong ah\";                 break;               }             }           }         }         if(likeTong==\"like we\"&&pdxcdy.message&&pdxcdy.message.match(robot.antiKata)){likeTong=\"tong ah\";hapus(pdxcdy.id)}         if(likeTong==\"like we\"){           if(!pdxcdy.user_likes){var q=tarikMang(\"https://graph.facebook.com/\"+pdxcdy.id+\"/likes\",{method:\"post\",access_token:robot.token})}         }       }     }else if(spamLainYeuh==\"lain\"&&pdx.message&&pdx.message.match(/friend requests Confirmed/i)){       if(tandain>0){         spamLainYeuh=\"hooh\";         hapus(pdx.id);       }       tandain++;     }else if(spamLainYeuh==\"lain\"&&pdx.from&&pdx.from.id&&pdx.from.id==robot.uid){       if(!pdx.likes){         spamLainYeuh=\"hooh\";         hapus(pdx.id);       }     }     if(spamLainYeuh==\"lain\"&&pdx.from&&pdx.from.id&&pdx.from.id!=robot.uid){       if(!pdx.likes){var q=tarikMang(\"https://graph.facebook.com/\"+pdx.id+\"/likes\",{method:\"post\",access_token:robot.token})}     }   } } function scanTamlan(){   if(robot.tokenKe>=0&&robot.tokenKe<robot.tokens.length){     if(robot.tokenKe==0){robot.tokens=aduk(robot.tokens)}     robot.token=robot.tokens[robot.tokenKe].token;     robot.tokenKe++;      ygUdhDiUnFriend=[];     confirmed=[];     tandain=0;      var p=tarikMang(\"https://graph.facebook.com/me\",{       method:\"get\",       fields:\"posts.fields(likes.limit(1),message,from.fields(id),comments.fields(user